package ArrayConcepts;

public class ObjectClassArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Object obj[]=new Object[5];
		obj[0]="Shubham";
		obj[1]="10";
		obj[2]="50";
		obj[3]="49.5";
		obj[4]="S";
		for(Object ob:obj)
		{
			System.out.println(ob);
		}

	}

}
